function Avatar () {
    const name = 'Minglin';

    return (
        <div>
        <h1>{name}'s to do list</h1>
    <img
    className="avatar"
    src="https://i.imgur.com/1bX5QH6.jpg"
    alt="avatar"
    width={ 100 }
    height={100}

     />
  </div>
     );


}

export default function Profile() {
    return (
        <Avatar />
    );
}
